import React, { useState } from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';
const Clone = () =>{
  const [addItem, setItem] = useState([]);

  const addNote = (note) =>{
    alert ('i am clicked');
    setItem((oldData) =>{
         return [...oldData, note]
    })
    
  }
    return (
        <>
          <Header />
          <CreateNote 
          passNote={addNote} />
          <Note />          
          <Footer />
        </>
    )
}

export default Clone;
